import React from "react";
import image1 from "../User-images/about1.webp";
import image2 from "../User-images/about1.webp";
import image3 from "../User-images/about1.webp";
import "./AboutUs.css";
function About() {
  return (
    <div>
      <h1
        style={{
          textAlign: "center",
          fontFamily: "sans-serif",
          fontSize: "50px",
          marginTop: "25px",
        }}
      >
        <b>About</b>
      </h1>
      <h5 style={{ textAlign: "center" }}>
        Who we are, what we do, and how we test products
      </h5>
      <hr
        style={{
          marginLeft: "5%",
          marginRight: "5%",
        }}
      />
      <img
        src={{ image1 }}
        alt="About image"
        style={{ width: "100%", height: "40%", objectFit: "cover" }}
      />
    </div>
  );
}

export default About;
